using MovieManagerMVC.Models;

namespace MovieManagerMVC.Data
{
    public class AppDbInitializer
    {
        public static void Seed(IApplicationBuilder builder)
        {
            using (var serviceScope = builder.ApplicationServices.CreateScope())
            {
                var ctx = serviceScope.ServiceProvider.GetRequiredService<AppDbContext>();
                ctx.Database.EnsureCreated();

                //Cinemas
                if (!ctx.Cinemas.Any())
                {
                    ctx.Cinemas.AddRange(new List<Cinema>()
                    {
                        new Cinema()
                        {
                            Logo = "data:image/png;base64,",
                            Name = "PVR",
                            Description = "Great for family"
                        }
                    });
                    ctx.SaveChanges();
                }
                //Actors
                if (!ctx.Actors.Any())
                {
                    ctx.Actors.AddRange(new List<Actor>()
                    {
                        new Actor()
                        {
                            ProfilePicture = "data:image/jpeg;base64,",
                            FullName = "Christian Bale",
                            Bio = "Great Actor"
                        }
                    });
                    ctx.SaveChanges();
                }
                //Producers
                if (!ctx.Producers.Any())
                {
                    ctx.Producers.AddRange(new List<Producer>()
                    {
                        new Producer()
                        {
                            ProfilePicture = "data:image/jpeg;base64,",
                            FullName = "Christopher Nolan",
                            Bio = "Great Director, Story Writer and Producer"
                        }
                    });
                    ctx.SaveChanges();
                }
                //Movies
                if (!ctx.Movies.Any())
                {
                    ctx.Movies.AddRange(new List<Movie>()
                    {
                        new Movie()
                        {
                            ImageUrl = "data:image/jpeg;base64,",
                            Name = "The Dark Knight",
                            Description = "Batman saves the city",
                            MovieCategory = MovieCategory.Action,
                            StartDate = new DateTime(2008, 08, 08),
                            EndDate = new DateTime(2008, 09, 07),
                            Price = 155,
                            CinemaId = 1,
                            ProducerId = 1
                        }
                    });
                    ctx.SaveChanges();
                }

                //Actors_Movies
                if (!ctx.Actors_Movies.Any())
                {
                    ctx.Actors_Movies.AddRange(new List<Actor_Movie>()
                    {
                        new Actor_Movie()
                        {
                            ActorId = 1,
                            MovieId = 1
                        }
                    });
                    ctx.SaveChanges();
                }
            }
        }
    }
}
